// Profile.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Profile.css';

const Profile = () => {
  const navigate = useNavigate();
  const userDetails = JSON.parse(localStorage.getItem('userDetails') || '{}');

  const handleLogout = () => {
    localStorage.removeItem('isAuthenticated');
    localStorage.removeItem('userDetails'); // Clear user details
    navigate('/login');
  };

  return (
    <div className="profile-container">
      <h1>Your Profile</h1>
      <div className="profile-details">
        <p>Username: {userDetails.username || 'N/A'}</p>
        <p>Email: {userDetails.email || 'N/A'}</p>
        <p>Phone Number: {userDetails.phone_number || 'N/A'}</p>
        <p>First Name: {userDetails.first_name || 'N/A'}</p>
        <p>Last Name: {userDetails.last_name || 'N/A'}</p>
      </div>
      <button onClick={handleLogout}>Sign Out</button>
    </div>
  );
};

export default Profile;
